import { Grid } from "@mui/material";
import Feed from "./components/Feed";
import Leftbar from "./components/Leftbar";
import Navbar from "./components/Navbar";
import Rightbar from "./components/Rightbar";

const App = () => {
  return (
    <div>
      <Grid container>
        <Grid item xs={12}>
          <Navbar />
        </Grid>
        <Grid item>
          <Leftbar />
        </Grid>
        <Grid item>
          <Feed />
        </Grid>
        <Grid item>
          <Rightbar />
        </Grid>
      </Grid>
    </div>
  );
};

export default App;
